import styled from 'styled-components';
import {FiMic,FiRadio } from 'react-icons/fi';
import Link from 'next/link'
import {explore} from './Icons';
const primary ='#309F5E';
const Sidebar = () => {
    return (
        <Wrapper>
            <Heading>Huda</Heading>
            <List>
                <FiMic color={primary}/>
                <Link href="/podcast"><a >Podcast</a></Link>
            </List>
            <List>
                <FiRadio color={primary}/>
                <Link href="/radio"><a >Radio</a></Link>
            </List>
        </Wrapper>
    )
}
const Wrapper = styled.aside`
background-color:#F6F7FB;
padding-top:23px;
padding-left:25px;
width:165px;
height:100vh;
`
const Heading = styled.h1`
font-size:32px;
`

const List = styled.li`
list-style:none;
`
export default Sidebar;
